import React from 'react';
import BookCard from '../BookCard';
import './index.css';

const BookList = ({bookList, pageNumber}) => {
    console.log('booklist - ', bookList)
    console.log('page number', pageNumber)
    const maxPageNumber = 3 * pageNumber;
    const minPageNumber = 3 * pageNumber - 2;
    console.log('check', maxPageNumber, minPageNumber)
    return (
        <div className="book-container">
            {
                bookList.filter((book) => {
                    if (book.id <= maxPageNumber && book.id >= minPageNumber) {
                        console.log('hello', book.id)
                        return (
                            <BookCard key={book.id} book={book} />
                        )
                    }
                    //     // console.log('entered')
                    // ? null
                    // : console.log('hello')
                    // : <BookCard key={index} book={book} />
                })
            }
        </div>
    );
};

export default BookList;
